function Navbar(){
  return(
    <nav>
      <ul>
        <li><a href="#"><h3>DigitalQ</h3></a></li>
        <Setting page="#about" sesi="About" />
                            <Setting page="#product" sesi="Product" />
                            <Setting page="#contact" sesi="Contact" />
                            <Setting page="review.html" sesi="Review" />
                            <Setting page="login.html" sesi="LOGIN" />
                        </ul>
                    </nav>
  )
}
